CREATE TABLE g5_ponto_de_onibus_canaleta(
   id_ponto   INTEGER  NOT NULL
  ,nome_ponto VARCHAR(34) NOT NULL
  ,rua        VARCHAR(30) NOT NULL
  ,numero     INTEGER  NOT NULL
  ,bairro     VARCHAR(15) NOT NULL
  ,regional   VARCHAR(16) NOT NULL
  ,id_bairro  INTEGER  NOT NULL
  ,PRIMARY KEY(id_ponto)
  ,FOREIGN KEY(id_bairro) REFERENCES g5_bairro_cidade(id_bairro)
);




